.el-pagination {
        font-size: 14px;
        color: #202224;
        font-weight: 400;
        margin-top: 8px;
        .el-pagination__total {
            color: #202224;
        }
        .el-pagination__jump {
            color: #202224;
        }
        .btn-prev,.btn-next {
          border: 1px solid #E7E7E7;
        }
        .el-pager {
            li {
                border: 1px solid #E7E7E7;
                color: #202224;
                font-weight: 400;
            }
            li:hover {
                background: #84C22E;
                color: #fff;
            }
            li.active {
                background: #79ac43;
                color: #fff;
            }
        }
    }
